import Layout from '../../../components/Layout';
import Admin from '../../../components/auth/Admin';
import { Grid, Label } from 'semantic-ui-react';

const CategoryTag = () => {
	return (
		<Layout>
			<Admin>
				<Grid>
					<h2>Manage Categories & Tags</h2>
					<Grid.Row>
						<Grid.Column width={6}>
							<div>
								<Label as="a" color="teal" tag>
									Featured
								</Label>
								<Label as="a" color="teal" tag>
									Featured
								</Label>
								<Label as="a" color="teal" tag>
									Featured
								</Label>
							</div>
						</Grid.Column>
						<Grid.Column width={6} />
					</Grid.Row>
				</Grid>
			</Admin>
		</Layout>
	);
};

export default CategoryTag;
